function getFreeCodeCampStreams(){$.ajax({type:"GET",url:"https://api.twitch.tv/kraken/streams/freecodecamp?callback=?",contentType:"application/json; charset=utf-8",async:!1,dataType:"json",success:function(e){getFreeCodeCampChannel()},error:function(e){console.log(e)}})}function getFreeCodeCampStreamStatus(e){return $.isEmptyObject(e.stream)}function getFreeCodeCampChannel(){$.ajax({type:"GET",url:"https://api.twitch.tv/kraken/channels/freecodecamp?callback=?",contentType:"application/json; charset=utf-8",async:!1,dataType:"json",success:function(e){console.log(e);var a=e.logo,t=e.display_name,r=e.url,s=e.followers,o=e.views;getFreeCodeCampStreamStatus(e)?displayOfflineStream(a,t,r,s,o):console.log("online")},error:function(e){console.log(e)}})}function getFeaturedStreams(){$.ajax({type:"GET",url:"https://api.twitch.tv/kraken/streams/featured?callback=?",contentType:"application/json; charset=utf-8",async:!1,dataType:"json",success:function(e){console.log("Featured Streams"),console.log(e),getDataFeaturedStreams(e)},error:function(e){console.log("Error"),displaySearchError('The search could not be perfomed. </h1><h3 class="search-error__header">Please, try again in a few moments...</h3>')}})}function displaySearchError(e){$(".stream-list").append('<div class="per-error u-center"><h1 class="search-error__header">'+e+"</h1></div>")}function getDataFeaturedStreams(e){for(var a=0;a<e.featured.length;a++){var t=e.featured[a].stream.channel.name,r=e.featured[a].stream.game,s=e.featured[a].title,o=e.featured[a].stream.channel.url,n=e.featured[a].stream.channel.logo;console.log(t+r),displayStream(s,o,t,r,n)}}function displayStream(e,a,t,r,s){$(".stream-list--online").append('<div class="stream"><a href="'+a+'"><div class="profile-image"><img src="'+s+'" alt=""></div><div class="profile-info"><p class="profile-info__header-1">'+e+'</p><p class="profile-info__header-2">Game: '+r+'</p><p class="profile-info__header-3">User: '+t+"</p></div></a></div>")}function displayOfflineStream(e,a,t,r,s){$(".stream-list--offline").append('<div class="stream stream--offline"><a href="'+t+'"><div class="profile-image"><img src="'+e+'" alt=""></div><div class="profile-info"><p class="profile-info__header-1">'+a+'</p><p class="profile-info__header-3">Followers: '+r+'</p><p class="profile-info__header-3">Views: '+s+"</p></div></a></div>")}$(document).ready(function(){getFeaturedStreams(),console.log("FreeCodeCamp"),getFreeCodeCampStreams(),$(".nav-tab__link").click(function(){$(".stream-list--online").toggle(),$(".stream-list--offline").toggle(),$(".nav-tab").toggleClass("nav-tab--active")}),setTimeout(function(){$(".nav, .stream-list").removeClass("u-hide")},1e3)});